import React, { Component } from 'react';
import { connect } from 'react-redux';

class Header extends Component {
  renderContent() {
    switch (this.props.auth) {
       case null:
         return;
       case false:
        return (
          <li>
            <a href="/auth/google" className='class-nav-fnt class-nav-fnt2'><i className="fab fa-google-plus-g fa-lg"> </i>  Sign in With Google</a> 
            </li>
        );
       default:
         return (
           <li>
             <a href=" " className="class-nav-fnt class-nav-fnt2"><i className="fas fa-sign-out-alt fa-lg"></i>  Log Out</a>
           </li>
         );
    }
  }

  render() {
    console.log(this.props.auth)
    return (
      <nav>
        <div className='nav-wrapper class-bg class-shadow'>
          <a className='left brand-logo class-mglf class-nav-fnt2' > 
            VT Emaily
          </a>
          <ul className='right'>
             {this.renderContent()}
          </ul>
        </div>
      </nav>
    );
  }
}

function mapStateToProps(state){
  return { auth : state.auth };
}

export default connect(mapStateToProps)(Header);
